import React, { useState } from 'react';
import './App.css';
import KeyPress from './component/KeyPress/KeyPress';

function App() {
  const [info, setInfo] = useState([]);
  return (
    <React.Fragment>
      <section>
      <div className='container'>
      <div className='componentA'>A</div>
      <div className='componentA'>B</div>
      </div>

      <div className='container'>
      <div className='componentA'>C</div>
      <div className='helper'>
        {info && info.map((obj) => (
          <div className='info_container'>
            <div className='title'>{`${obj.title} : `}</div>
            <div className='combo'>{`${obj.combo} : `}</div>
            <div className='description'>{`${obj.des}`}</div>
          </div>
        ))}
      </div>
      </div>
      </section>
    </React.Fragment>
  );
}

export default App;
